import React from 'react';
import {Switch, Route} from 'react-router-dom';
//hooking together all pages
import LandingPage from './landingpage';


const Main = () => (
  <Switch>
    <Route exact path="/h" component={LandingPage} />
  </Switch>
)

  export default Main;
